window.bookSummaryJSON = "<p><b>I get off on pain....</b></p> <p>On how I make her writhe under me.</p> <p>Seduce her into calling out to me.</p> <p>Teasing her, enticing her to cry out as I mark her flesh.</p> <p>Lick her rounded curves.</p> <p>Tie her down and claim her and...</p> <p>I know what you are thinking.</p> <p>That I demand complete power exchange?</p> <p>True.</p> <p>That I will not stop until I have broken her?</p> <p>Yep!</p> <p>But here's something else....</p> <p>I am hers because she chooses me.</p> <p>I have control because she believes that I deserve it.</p> <p>I punish her because she allows it.</p> <p>I own her because she gives herself to me.</p> <p>She settles that primal anger inside me, even as she incites the need to possess.</p> <p>To protect.</p> <p>And I will not stop until she is <i>mine</i>.</p> <p><b>This is Doc, a.k.a. Nolan, and Alice's story. Inside: snarly, brooding, flawed Fae male who will not stop until he's claimed his soulmate.</b></p>"; 
